import React, { memo } from "react";

const Songs = ({ thumbnail, artistsNames, releaseDate }) => {
  return (
    <div className="w-[32%] flex hover:bg-hover items-center  ">
      
      <div>
        <span>{artistsNames}</span>
        <span>releaseDate</span>
      </div>
    </div>
  );
};

export default memo(Songs);
